window.bookSummaryJSON = "<p><b>Whatever the desires of your heart, </b><b><i>Change Your World </i></b><b>will guide you through the entire process to take action and start making an impact today, right where you are.</b></p> <p>You can bring about positive, lasting change in the world, and you don’t have to be rich and famous or lead a big organization to do it.</p> <p>Global leadership icons and best-selling authors John C. Maxwell and Rob Hoskins provide the inspiring and practical roadmap to get started being the change you want to see - in your community and beyond.</p> <p>Learn from the firsthand experiences shared by the authors from their work helping to transform communities, businesses, and millions of lives around the world.</p> <p>In <i>Change Your World</i>, Maxwell and Hoskins will show you how to:</p> <p></p> <ul> <li>Identify your cause</li> <li>Live out the values that make a difference</li> <li>Become a catalyst for change</li> <li>Join the right team or recruit one of your own</li> <li>Work together with others to make a difference</li> <li>Measure your impact and keep improving</li> </ul> <p>For many of us, the world we live in feels broken, yet change is easier than we think. You’ll not only be encouraged to make a difference based on the needs you see around you, but you’ll be equipped to implement change immediately.</p>"; 
